import {BookPreviewContainer} from './BookPreview.style';

export function BookPreview({book}){
    return(
        <BookPreviewContainer>
            <img src={book?.coverUrl} alt={''} width={"200px"}/>
            <BookDetailsContainer>
                <h3>{book?.title}</h3>
                <h5>{book?.description}</h5>
                <p>{book?.genre}</p>
                <p>{book?.author}</p>
                <p>{book?.publicationDate}</p>
                <p>{book?.price}</p>
            </BookDetailsContainer>
        </BookPreviewContainer>
    )
};
